import "./App.css";

function App() {
  return (
    <div
      className="App"
      class="flex flex-col justify-center items-center w-screen h-screen bg-slate-200"
    >
      <p class="text-gray-900 text-center text-9xl font-serif italic drop-shadow-lg">
        It works!
      </p>
    </div>
  );
}

export default App;
